import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-dom';
import Home from './pages/Home'
import Knowledges from './pages/Knowledges';
import Contact from './pages/Contact';
import NotFound from './pages/NotFound';
import PorteFolio from './pages/PorteFolio';


const App = () => {
  return (
    <div>
      <>
      <BrowserRouter>
        <Route path="/" componant={home} />
        <Route path="/competences" componant={Knowledges} />
        <Route path="/portefolio" componant={PorteFolio} />
        <Route path="/contact" componant={Contact} />
        <Route path="/notfound" componant={NotFound} />

      </BrowserRouter>

      </>
    </div>
  );
};

export default App;
